import React, { Component } from "react";
import { Link } from "react-router-dom";
import { Button, ButtonGroup, Container, Table } from "reactstrap";

class Home extends Component {
  constructor(props) {
    super(props);
    this.state = { slams: [], isloading: false };
  }
  componentDidMount() {
    this.setState({ isLoading: true });
    fetch("apz/slams")
      .then(response => response.json())
      .then(data => this.setState({ slams: data, isLoading: false }));
  }
  render() {
    return (
      <div className="App">
        <p className="bg-primary">Welcome!! this is home page</p>
        {console.log(this.state.slams)}
        <Button color="success" tag={Link} to="/createSlam">
          create new slam
        </Button>
      </div>
    );
  }
}

export default Home;
